class Solution {
public:
    int findMinimumOperations(string s1, string s2, string s3) {
        // The idea is to iterate from the end of the strings and find the common substring.
        // If at any point, the characters differ, and it's not possible to trim them to make the strings equal, return -1.
        // Otherwise, calculate the number of operations needed to make them equal.

        int i = s1.size() - 1, j = s2.size() - 1, k = s3.size() - 1;
        int operations = 0;

        while (i >= 0 || j >= 0 || k >= 0) {
            char c1 = i >= 0 ? s1[i] : 0;
            char c2 = j >= 0 ? s2[j] : 0;
            char c3 = k >= 0 ? s3[k] : 0;

            // If all non-zero characters are equal, move to the next character.
            if ((c1 == c2 || c1 == 0 || c2 == 0) && (c2 == c3 || c2 == 0 || c3 == 0) && (c1 == c3 || c1 == 0 || c3 == 0)) {
                if (c1 != 0) i--;
                if (c2 != 0) j--;
                if (c3 != 0) k--;
            } else {
                // If characters differ, perform an operation on the longer string(s).
                if (i >= j && i >= k && i >= 0) { i--; operations++; }
                else if (j > i && j >= k && j >= 0) { j--; operations++; }
                else if (k > i && k > j && k >= 0) { k--; operations++; }
                else return -1; // If we cannot make a move to equalize, return -1.
            }
        }

        // Check for the case where all strings are made equal.
        return operations;
    }
};
